import * as React from 'react';
import { motion, Variants } from 'framer-motion';
import { MenuItem } from './MenuItem';

const variants = {
  open: {
    transition: {
      delayChildren: 0.2,
      staggerChildren: 0.07,
    },
  },
  closed: {
    transition: {
      staggerChildren: 0.05,
      staggerDirection: -1,
    },
  },
};

export const Navigation = props => {
  const menuLinks = [
    {
      name: 'About',
      url: 'about',
    },
    {
      name: 'Projects',
      url: 'project-section',
    },
    {
      name: 'Contact Me',
      url: 'contact',
    },
  ];

  const menuIcons = [
    {
      name: 'About',
      url: 'about',
    },
    {
      name: 'Projects',
      url: 'project-section',
    },
  ];

  return (
    <div className="navigation-container">
      <motion.ul variants={variants}>
        {menuLinks.map(({ name, url }, i) => (
          <MenuItem key={i} name={name} url={url} />
        ))}
      </motion.ul>
      <div className="side-drawer-horizontal-divider"></div>
      <motion.ul variants={variants}>
        {menuLinks.map(({ name, url }, i) => (
          <MenuItem key={i} name={name} url={url} />
        ))}
      </motion.ul>
    </div>
  );
};
